import React from 'react';
import Navbar from "./navbar";
import Footer from "./Footer";

const AppLayout = ({children}) => {
    return (
        <>
            <Navbar/>
            <hr/>
                {children}
            <Footer/>
        </>
    );
};

export default AppLayout;
